import React from 'react'
import DevIcon from "devicon-react-svg";

function Technologies() {
  return (
    <div>
        <div>
            <h1 style>Technologies that I use</h1>
        </div>
        <div>
        <DevIcon icon="react" />
        </div>
    </div>
  )
}

export default Technologies
